import React from 'react';
import { Navbar, Nav, NavbarBrand, NavbarToggler, Collapse, NavItem, NavLink } from 'reactstrap';
import SignedInLinks from './SignedInLinks';

export default class Navbare extends React.Component {
  render() {
    return (
      <div>
        <Navbar color="dark" light expand="md">
            <NavbarBrand href="/">BKK e-Jegy</NavbarBrand>
            <NavbarToggler onClick={this.toggle} />
            /*<Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/components/">FÅ‘oldal</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
              </NavItem>
            </Nav>*/
        <SignedInLinks />
        </Navbar>
      </div>
    );
  }
}
